import {Route,Routes} from "react-router"

import logo from './logo.svg';
import './App.css';
import SignUp from './components/SignUp';
import Principal from './components/Principal';
import Inicio from './components/Inicio'
import Cuentas from './components/Cuentas'
import Login from '/components'

function App() {
  return (
  <>

    <Routes>
      <Route
      path="/"
      exact 
      element={
        <>
          <Inicio />
        </>
      }>

      </Route>

      <Route
      path="/Principal"
      exact 
      element={
        <>
          <Principal/>
        </>
      }></Route>

      <Route
       path="/SignUp"
       exact 
       element={
         <>
           <SignUp/>
         </>
       }></Route>

      <Route
       path="/Login"
       exact 
       element={
         <>
           <Login/>
         </>
       }></Route>

      <Route
       path="/Cuentas"
       exact 
       element={
         <>
           <Cuentas/>
         </>
       }></Route>
    </Routes>
  </>

  );
}

export default App;
